import React from "react";

function About() {
  return (
    <div className="max-w-4xl mx-auto py-12 px-4">
      <h1 className="text-3xl font-bold mb-4 text-blue-700">About Gajulapalli Infra</h1>
      <p className="mb-4 text-gray-700">Gajulapalli Infra and Constructions has been a leader in the construction industry for over 20 years, delivering high-quality residential, commercial, and industrial projects across the region.</p>
      <h2 className="text-2xl font-semibold mt-8 mb-2">Our Mission</h2>
      <p className="mb-4 text-gray-700">To build lasting relationships with our clients by delivering exceptional construction solutions with integrity, innovation, and excellence.</p>
      <h2 className="text-2xl font-semibold mt-8 mb-2">Our Values</h2>
      <ul className="list-disc list-inside text-gray-700">
        <li>Quality Craftsmanship</li>
        <li>Customer Satisfaction</li>
        <li>Timely Delivery</li>
        <li>Safety First</li>
        <li>Innovation</li>
        <li>Transparency</li>
      </ul>
    </div>
  );
}

export default About;
